class Solution(object):
    def maxOperations(self, s):
        """
        :type s: str
        :rtype: int
        """
        ones=0
        ans=0
        n=len(s)
        for i in range(1,n):
            if s[i-1]=='1':
                ones+=1 
            if s[i]=='0' and s[i-1]=='1':
                ans+=ones
        return ans
